function SyntaxNode(name) {
    this.name = name;
    this.children = [];
}

function p_start(tokens, libs) {

    var stack = [0];
    var j = 0;
    var symbols = [];

    //console.log(tokens);

    for (var i = 0; i < tokens.length; i++) {

        var top = stack[stack.length - 1];

        //console.log(top + ", " + tokens[i]);

        var action = t_action[top][tokens[i][0]];

        var tree;

        //console.log("->   " + action);
        if (action == 'a') {
            //alert('accepted!');
            //console.log(symbols);
            var strsym = JSON.stringify(symbols[0]);
            //sconsole.log(strsym);
            //console.log("lolololololol")
            cg_start(symbols[0], libs);
            return;
        } else if (action.charAt(0) == 's') {
            var shift = parseInt(action.substr(1, action.length - 1));   
            stack.push(shift);
            sn = new SyntaxNode(tokens[i][2]);
            sn.children[0] = new SyntaxNode(tokens[i][1]);
            symbols.push(sn);
        } else if (action.charAt(0) == 'r') {
            var reduce = parseInt(action.substr(1, action.length - 1));    
            ////console.log(j + ":    " + reductions[reduce]) ;
            res = nts[reduce];

            var nt = res[0];
            var totalrules = res[1];

            //console.log("reduce->>>>" + nt + " " + totalrules);
            node = new SyntaxNode(reductions[reduce].split(' ')[0]);

            for (var k = 0; k < totalrules; k++) { 
                stack.pop();
            }

            for (var k = 0; k < totalrules; k++) { 
                node.children.push(symbols.pop());
            }
            node.children.reverse();
            symbols.push(node);

            top = stack[stack.length - 1];
            action = t_goto[top][nt];
            //console.log("goto: "+action + " " + i);   
            if (action == '') {
                alert('Goto-error');
                return;
            }

            stack.push(action);
            if (i > 0) i--;

            j++;

        } else {
            var out = document.getElementById("diagnostic");
    		out.value = "PARSER ERROR: \n\t";
    		if(tokens[i][1] == "\\EOF") {
    			out.value += "Unexpected end of file";
    		}
            return;
        }

    }


}